  false,\n\t\"url\": null,\n\t\"notes\": \"Methods proposed to monitor the effect
  of the treatment program on arctic fox and on non-target species such as raptors
  and avian scavengers that may be indirectly exposed to the toxicant. Methods to
  monitor other bird species on Kiska are also presented. A field crew composed of
  a minimum of four biologists will be present on the island for about three weeks
  (June 4-24) in 1985 to initiate the studies. The monitoring program will continue
  in future years as the fox eradication effort progresses.\",\n\t\"license_title\":
